import React from "react";
import { Container, Button, Icon } from "../index";
import "./style.scss";

function Header() {
	return (
		<header className="header">
			<Container className="header__container">
				<Icon icon="knife-kitchen" size="large"/>
				<Button
					className="button--small"
					label="Get in touch"
				/>
			</Container>
		</header>
	);
}

export default Header;
